A dress-up roguelike game. Advance through the dungeon with the items you pick up.

Story:
&quot;I'm Leila, even if it looks like this, I'm a first-class adventurer at level 99!&quot;
&quot;Last night I drank booty liquor and fell asleep on the way.
When I woke up, I was alone in a strange dungeon!&quot;
&quot;And for some reason, there are no clothes or items, and the level that should have been trained has dropped to 1.&quot;
&quot;At this level right now, you can only beat one weak wolf.&quot;
&quot;I must escape from this dungeon.&quot;
